function () {
    cy.step('Click to open E-commerce');
    var ecom = workspace.getLeftSidebar().clickECommerceButton();
    cy.step('Click to open the products panel');
    product = ecom.clickProductCollection();
    cy.step('Click to create a new product');
    productForm = product.clickNewProductButton();
    cy.step('Purposefully error the bulk SKU creation endpoint');
    cy.route2(_cypressAppControls.server.paths.bulkCreateSKUs, function (req) {
      req.reply(function (res) {
        res.send(500);
      });
    }).as('bulk-create-skus-error');
    cy.step('Attempt to create a new product with variants');
    var detailedProduct = {
      name: 'My Detailed Product',
      price: 89.99,
      variants: [{
        name: 'Size',
        options: ['S', 'L']
      }, {
        name: 'Colors',
        options: ['Red', 'Blue']
      }],
      saveStatus: 'stage'
    };
    productForm.fill(detailedProduct);
    cy.step('Wait for the endpoint of the failed SKU generation');
    cy.wait('@bulk-create-skus-error');
    cy.step('Assert that the product form is still open');
    productForm.getSaveButton().should('be.visible');
    cy.step('Verify an error is shown to the user after SKU generation fails');
    cy.getByDataAutomationId('notification-container').should('have.text', 'Could not create product variants.');
  }

function () {
    cy.step('Verify you can resave the product');
    productForm.getSaveButton().should('be.visible').click();
    cy.step('Assert that the product form is closed and the Products panel is open again');
    cy.getByDataAutomationId('cms-add-item-button').contains('New Product').should('be.visible');
    cy.step("Assert that the product name typed in is 'My Detailed Product'");
    product.getProduct(0).within(function () {
      product.getProductColumn(0).should('contain', 'My Detailed Product');
    });
    cy.step('Assert that the product price typed in is correct');
    product.getProductColumn(2).should('contain', '89.99');
    cy.step('Assert that the product status is correct');
    product.getProductColumn(3).should('contain', 'Staged for Publish');
  }

